const Card = () => {
	return(
		<div className="bg-light-green dib pd3">
			<img alt="robots" src="https://robohash.org/test"/>
			<div>
				<h2>Mike Winer</h2>
				<p>winer.mike@gmail.com</p>
			</div>
		</div>

	);
}

export default Card;
